import React from 'react';
import classes from './users.module.css';
const Users = (props) => {
    return <div>
        <div>
            {
                props.users.map( u=><div key={u.id}>
                 <div className={classes.container}></div>
                </div>)
            }
        </div>
    </div>

}
export default Users;
